<!DOCTYPE html>
<html lang="en">
  <head>
    <meta charset="utf-8">
    <meta http-equiv="X-UA-Compatible" content="IE=edge">
    <meta name="viewport" content="width=device-width, initial-scale=1">
    <title></title>
    <link rel="stylesheet" href="style.css" media="screen" title="no title" charset="utf-8">
    <!--[if lt IE 9]>
      <script src="https://oss.maxcdn.com/libs/html5shiv/3.7.2/html5shiv.js"></script>
      <script src="https://oss.maxcdn.com/libs/respond.js/1.4.2/respond.min.js"></script>
    <![endif]-->
  </head>
  <body>
    <header>
      <div class="block header-block block-1">&nbsp;</div>
      <div class="block header-block block-2">&nbsp;</div>
      <div class="block header-block block-3">&nbsp;</div>
    </header>
    <hr>
    <div class="container">
      <div class="sidebar">
        <div class="block sidebar-block block-4">&nbsp;</div>
        <div class="block sidebar-block block-7">&nbsp;</div>
      </div>
      <div class="main">
        <div class="main-block block-5">&nbsp;</div>
        <div class="middle">
          <div class="middle-top">
            <div class="main-block block-6 block-middle-1">&nbsp;</div>
            <div class="main-block block-6 block-middle-2">&nbsp;</div>
            <div class="main-block block-6 block-middle-3">&nbsp;</div>
            <div class="main-block block-6 block-middle-4">&nbsp;</div>
            <div class="main-block block-6 block-middle-5">&nbsp;</div>
          </div>
          <div class="middle-bottom">
            <div class="main-block block-6 block-middle-6">&nbsp;</div>
            <div class="main-block block-6 block-middle-7">&nbsp;</div>
          </div>
        </div>
        <div class="bottom">
          <div class="main-block block-8">&nbsp;</div>
          <div class="main-block block-9">&nbsp;</div>
        </div>
      </div>
    </div>
    <hr>
    <footer>
      <div class="foot">&nbsp;</div>
      <div class="foot">&nbsp;</div>
      <div class="foot-right">
        <div class="footsmall-1">&nbsp;</div>
        <div class="footsmall-2">&nbsp;</div>
      </div>
    </footer>
  </body>
</html>
